import React from 'react';

const IconLogo = () => (

  <svg xmlns="http://www.w3.org/2000/svg" role="img" width="100" height="100" viewBox="0 0 100 100">
  <image id="Background" width="100" height="100" href="data:img/png;base64,"/>
  <image id="Group_1" data-name="Group 1" x="20" y="7" width="54" height="75" href="data:img/png;base64,"/>
</svg>

);

export default IconLogo;
